import React from 'react';
import logo from './logo.svg';
import './App.css';
import Mock from './Mock';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import ButtonGroup from 'react-bootstrap/ButtonGroup'
import Button from 'react-bootstrap/Button'
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup'
import ToggleButton from 'react-bootstrap/ToggleButton'
import Card from 'react-bootstrap/Card'


function App() {
  return (
    <div className="App">
      <link
        rel="stylesheet"
        href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
        crossorigin="anonymous"
      />

      <Top />

    </div>
  );
}

function useState() {
  alert("Changed page, haha")
}

function pageController() {

  //const [value, setValue] = useState([1, 3]);



}




class Top extends React.Component {


  state = { message: "" }
  callbackFunction = (childData) => { this.setState({ message: childData }) }

  render() {
    return (
      <Container>
        <div className="Header">
          <h1 className="logo">
            Mocker
          </h1>
          <ToggleButtonGroup type="radio" name="pages" size="lg" className="btnGrp">
            <ToggleButton variant="danger">About</ToggleButton>
            <ToggleButton variant="danger">Share</ToggleButton>
            <ToggleButton variant="danger" active>Create</ToggleButton>
            <ToggleButton variant="danger">Load</ToggleButton>
            <ToggleButton variant="danger">Donate</ToggleButton>
          </ToggleButtonGroup>



        </div>
        <Mock parentCallBack={this.callbackFunction}/>
      </Container>

    );
  }
}


export default App;
